import { combineReducers } from "redux"  //合并多个  reducer
import cinemaReducer from "./cinemaReducer"
import mineReducer from "./mineReducer"


const RootReducer = combineReducers({
    cinemaReducer,
    mineReducer
});

export default RootReducer
